import React from "react";

import { Link } from "react-router-dom";
const Dashboard = () => {
  return (
    <>
      {/* Sidebar - collapses into a top navbar on smaller screens */}
     
      {/* Fixed Header */}
      

      {/* Main Content */}
      <div className="container" >
    
      <div className="container">
        <h1><a>Dashboard</a></h1>
        <hr/>

      </div>
      <div className="content container" style={{ marginLeft: "280px",marginRight:"200px", bottom: "0" }}>
        <h2>Responsive Sidebar Example</h2>
        <p>This example uses media queries to transform the sidebar into a top navigation bar on smaller screens.</p>
        <p>We've also added styling to stack and center the navigation links on very small screens.</p>
        <h3>Resize the browser window to see the effect.</h3>
        <p>Additional content here...</p>
      </div>
      </div>
      

      {/* Footer */}
      <div className="container-fluid py-3 my-4 border-top bg-light">
        <div className="d-flex justify-content-center">
          <span>Â© 2024 Company, Inc</span>
          <ul className="list-unstyled d-flex">
            <li className="ms-3"><a className="text-secondary" href="#">Twitter</a></li>
            <li className="ms-3"><a className="text-secondary" href="#">Instagram</a></li>
            <li className="ms-3"><a className="text-secondary" href="#">Facebook</a></li>
          </ul>
        </div>
      </div>
    </>
  );
};

export default Dashboard;
